import '../HomePage/page1.css';

const ClothingtipPage3 = ({ }) =>
    <div id="tipapp">
        <Header />

        <Link href="/TipPage1">
        <div className="backbutton">
        <BackButton/>
        </div>
        </Link>

        <ClothingTip1
